import React from "react";
import "./Dail.css";

const Dail = () => {
  return (
    <>
      <div className="container">
        <div className="row">
          <div className="col text-center">
            <h1> Chosse a Dail </h1>
          </div>
        </div>
      </div>
    </>
  );
};

export default Dail;
